		time = "",
		type = 2,
		display_rare = 5,
		rare = 5,
		desc = "<color=#9A9A9A>修正者介绍</color>\n家族的继承人，在与深空之眼合资完毕后加入董事会，现在是第三部门的管理者。拥有令人吃惊的果决和魄力。",
