	[1071] = {
		param = "",
		name = "青君·孟章",
		time = "",
		type = 2,
		display_rare = 5,
		rare = 5,
		desc = "<color=#9A9A9A>修正者介绍</color>\n四方院嵎夷（东岛）代理人孟章，是最晚进入四方院的代理人，也是四方院中显得最为游手好闲的一位。\n常年不在其位，不知所踪已经是司空见惯之事。如果真想找孟章，或许可以去古玩市井多转几圈。",
		desc_source = "",
		sub_type = 0,
		littleicon = "",
		id = 1071,
		icon = "1071",
		use = 0,
		max = 0,
		source = {}
	},
	[1070] = {
		param = "",
		name = "十曜·金乌",
		time = "",
		type = 2,
		display_rare = 5,
		rare = 5,
		desc = "<color=#9A9A9A>修正者介绍</color>\n金乌，虚恒出身，从小跟随老师羲和在南交岛若木宫修行天通术。正义凛然，仗义直为，不过不知为何有些中二病。\n遵从老师的嘱托，目前正在下山云游历练中。",
		desc_source = "",
		sub_type = 0,
		littleicon = "",
		id = 1070,
		icon = "1070",
		use = 0,
		max = 0,
		source = {}
	},
	[1081] = {
		param = "",
		name = "斩浪·丝卡蒂",
		time = "",
		type = 2,
		display_rare = 5,
		rare = 5,
		desc = "<color=#9A9A9A>修正者介绍</color>\n丝卡蒂是极少数直接接受休指挥的第九部门外勤修正者，专门负责调查远洋区域的视骸活动迹象。虽然她表面上看起来大大咧咧，但到了关键时刻，她总能展现出一位船长该有的魄力。",
		desc_source = "",
		sub_type = 0,
		littleicon = "",
