		rare = 4,
		desc = "<color=#9A9A9A>修正者介绍</color>\n马尔杜克的养子，阿卡德公会实质上的二把手。性格高傲、不苟言笑，但处理任务的效率和完成度都很高，思路灵活，也是阿卡德公会难得的智将。",
