		display_rare = 5,
		rare = 5,
		desc = "<color=#9A9A9A>修正者介绍</color>\n四方院南岛的代理人，医者出身，深知苍生疾苦。她在南交设立了医馆「赤炁堂」，并开设了许多分部，广传病征解法。\n陵光经常亲自坐镇医馆，为上门求医的患者救治，并倾听他们的生活琐碎。",
